# Purificación de OEIS: Reducción a núcleos SF únicos
oeis_congruentes = {Integer(n).squarefree_part() for n in oeis_raw}

# --- 2. PROCESAMIENTO DEL DATASET ---
archivo_csv = 'db_k3_gigante_ratio_autosave.csv'
tus_sf = set()

print("Leyendo dataset y purificando núcleos...")
with open(archivo_csv, 'r') as f:
    reader = csv.DictReader(f)
    for i, row in enumerate(reader):
        n_orig = Integer(row['n'])
        n_pure = n_orig.squarefree_part()
        if n_pure <= _sage_const_1000 :
            tus_sf.add(n_pure)
        if i % _sage_const_100000  == _sage_const_0  and i > _sage_const_0 :
            print(f"   ... {i} filas procesadas")

# --- 3. CRUCE DE DATOS ---
