# --- 4. ANÁLISIS DE RANGO CON MONITOREO ---
print("\nAnalizando Rango de los núcleos adicionales (Exceso)...")
rango_positivo = _sage_const_0 
total_exceso = len(exceso_operador)

for i, n in enumerate(exceso_operador, _sage_const_1 ):
    try:
        E = EllipticCurve([-n**_sage_const_2 , _sage_const_0 ])
        # Usamos limit=10 para no atascarse en curvas imposibles
        r = E.rank(only_use_mwrank=False)
        if r > _sage_const_0 :
            rango_positivo += _sage_const_1 
    except:
        # Si Sage no puede probar el rango, lo contamos como potencial 0 para rigor
        pass
    
    if i % _sage_const_50  == _sage_const_0 :
        print(f"   ... analizados {i}/{total_exceso} núcleos adicionales")

print(f"\nNúcleos adicionales con Rank > 0: {rango_positivo}")
print(f"Núcleos adicionales con Rank = 0: {total_exceso - rango_positivo}")

